import TransactionList from "./components/transactionList";
import  {GlobalProvider}  from "./context/GlobalState"


function App() {
  return (
    <>
     <GlobalProvider>
     <Header />

<div className="container">
  <Balance />
  <IncomExpansis />
  <TransactionList />
  <Addatransation />
</div>
     </GlobalProvider>
    </>
  );
}

export default App;
